import { Link } from 'react-rouder-dom'
export default class AppNavbar extends Component {
    render() {
        return (
            <nav className="navbar navbar-expand-md navbar-dark bg-primary md-4">
                <div className ="container">
                    <Link to="/" to className="navbar-brand"> ClientPanel</Link>
                    <button className="navbar-toggler" type="button" data-toggle="collapse"  data-target=""></button>
                </div>
            </nav>   
        )
    }
}
